import React from 'react';
import AddForm from './AddForm'
import TodoList from './TodoList'
import Contact from './Contact'

function ContactsPage({contacts}){
    return (
        <div>
        {contacts.map(contact => (
      <Contact
       contact={contact}
       />
      ))}
        </div>
    )
}

export default ContactsPage;
